    true,nt"url": null,nt"notes": "This data set provides meteorological measurements
    collected from 3 different meteorological stations within a radius of 8 km in Rio
    Branco, Acre  Brazil, for  the periods of  June of 1970 to 1974, December of 1974
    to 1980, and  May of 1980 thru May 31, 2001. Daily average values for rainfall,
    relative humidity, evapotranspiration, maximum and minimum temperature, pressure,
    wind direction and speed, solar radiation, and cloud cover are reported.  There
    is one comma-delimited data file with this data set.",nt"license_title": "U.S.
